import React from 'react';


const MovieForm = (props) => {

    const {match, history} = props;

    return ( 
        <div>

         <h1>Movie Form {match.params.id} </h1>
         <button className='btn btn-primary' onClick={() => history.push('/movies')}>Save</button>
        </div>
     );


}

export default MovieForm;
